-- Part 2: Ensuring the solidity of my operational layer

-- Checking for missing affiliation IDs in the affiliation_relationship table
SELECT ar.agent_id, ar.affiliation_id
FROM affiliation_relationship ar
LEFT JOIN affiliation a ON ar.affiliation_id = a.affiliation_id
WHERE a.affiliation_id IS NULL;

-- Checking for missing agent IDs in related tables
SELECT lr.agent_id
FROM language_relationship lr
LEFT JOIN agent a ON lr.agent_id = a.agent_id
WHERE a.agent_id IS NULL;

-- Checking for NULL values in NOT NULL columns
SELECT * FROM agent WHERE agent_id IS NULL OR first_name IS NULL;
SELECT * FROM mission WHERE mission_id IS NULL OR mission_name IS NULL;

-- Checking for negative salaries or unreasonable values
SELECT * FROM agent WHERE salary < 0;

-- Verifying that mission statuses follow a defined set of values
SELECT DISTINCT mission_status FROM mission;

-- Checking for duplicate affiliations by name
SELECT affiliation_name, COUNT(*)
FROM affiliation
GROUP BY affiliation_name
HAVING COUNT(*) > 1;

-- Checking for duplicate agent entries
SELECT agent_id, COUNT(*)
FROM agent
GROUP BY agent_id
HAVING COUNT(*) > 1;

-- Adding a NOT NULL constraint
ALTER TABLE agent MODIFY salary DECIMAL(10, 2) NOT NULL;

-- Checking for primary and foreing key constraints
SELECT TABLE_NAME, COLUMN_NAME, DATA_TYPE
FROM information_schema.COLUMNS
WHERE TABLE_SCHEMA = 'spy_project';

