    TABLE_NAME, 
    COLUMN_NAME, 
    CONSTRAINT_NAME, 
    REFERENCED_TABLE_NAME, 
    REFERENCED_COLUMN_NAME 
FROM information_schema.KEY_COLUMN_USAGE 
WHERE TABLE_SCHEMA = 'spy_project' 
  AND REFERENCED_TABLE_NAME IS NOT NULL;
  
-- Part 3: Analytics
-- Step 1: Create the Agent Performance Analytical Table
DROP TABLE IF EXISTS agent_performance;
CREATE TABLE agent_performance AS
SELECT 
    a.agent_id, 
    CONCAT(a.first_name, ' ', a.last_name) AS agent_name, 
    COUNT(m.mission_id) AS total_missions, 
    SUM(CASE WHEN m.mission_status = 'Completed' THEN 1 ELSE 0 END) AS successful_missions, 
    COUNT(DISTINCT m.team_id) AS teams_participated,
    AVG(a.salary) AS average_salary
FROM 
    agent a
LEFT JOIN 
    mission m ON a.agent_id = m.agent_id
GROUP BY 
    a.agent_id;

-- Step 2: Create the Skill Proficiency Analytical Table
DROP TABLE IF EXISTS skill_proficiency;
CREATE TABLE skill_proficiency AS
SELECT 
    a.agent_id, 
    CONCAT(a.first_name, ' ', a.last_name) AS agent_name, 
    COUNT(DISTINCT s.skill_id) AS total_skills
FROM 
    agent a
LEFT JOIN 
    skill_relationship sr ON a.agent_id = sr.agent_id
LEFT JOIN 
    skill s ON sr.skill_id = s.skill_id
GROUP BY 
    a.agent_id;

-- Step 3: Create the Team Effectiveness Analytical Table
DROP TABLE IF EXISTS team_effectiveness;
CREATE TABLE team_effectiveness AS
SELECT 
    t.team_id, 
    t.team_name, 
    COUNT(m.mission_id) AS total_missions, 
    SUM(CASE WHEN m.mission_status = 'Completed' THEN 1 ELSE 0 END) AS successful_missions,
    ROUND(SUM(CASE WHEN m.mission_status = 'Completed' THEN 1 ELSE 0 END) / COUNT(m.mission_id) * 100, 2) AS success_rate
FROM 
    team t
LEFT JOIN 
    mission m ON t.team_id = m.team_id
GROUP BY 
    t.team_id;
    
