    COUNT(ar.affiliation_id) AS total_affiliations, 
    AVG(CASE 
            WHEN ar.affiliation_strength = 'Strong' THEN 3
            WHEN ar.affiliation_strength = 'Medium' THEN 2
            WHEN ar.affiliation_strength = 'Low' THEN 1
            ELSE 0
        END) AS avg_affiliation_strength
FROM 
    agent a
LEFT JOIN 
    affiliation_relationship ar ON a.agent_id = ar.agent_id
GROUP BY 
    a.agent_id;
    
-- Step 5: Create the Mission Summary Analytical Table
DROP TABLE IF EXISTS mission_summary;
CREATE TABLE mission_summary AS
SELECT 
    m.mission_id, 
    m.mission_name, 
    m.location, 
    CONCAT(a.first_name, ' ', a.last_name) AS agent_name, 
    t.team_name, 
    sc.sc_level AS security_clearance_level, 
    m.mission_status
FROM 
    mission m
LEFT JOIN 
    agent a ON m.agent_id = a.agent_id
LEFT JOIN 
    team t ON m.team_id = t.team_id
LEFT JOIN 
    security_clearance sc ON m.access_id = sc.sc_id;
    
