-- ### 2.1 Agent Performance
-- **Q1: Which agents have the highest mission success rates?**
DROP PROCEDURE IF EXISTS GetTopPerformingAgentsFromDataMart;
DELIMITER $$

CREATE PROCEDURE GetTopPerformingAgentsFromDataMart()
BEGIN
    SELECT 
        agent_id, 
        agent_name, 
        total_missions, 
        successful_missions, 
        ROUND((successful_missions / total_missions) * 100, 2) AS success_rate
    FROM 
        agent_performance_view
    WHERE 
        total_missions > 0
    ORDER BY 
        success_rate DESC
    LIMIT 10;
END$$

DELIMITER ;

-- **Q2: How does agent performance vary based on their affiliations, skills, and team assignments?**

DROP PROCEDURE IF EXISTS GetAgentPerformanceByFactors;
DELIMITER $$

CREATE PROCEDURE GetAgentPerformanceByFactors()
BEGIN
    SELECT 
        ap.agent_id, 
        ap.agent_name, 
        ap.total_missions, 
        ap.successful_missions, 
        am.total_affiliations, 
        am.avg_affiliation_strength,
        sp.total_skills,
        te.total_missions AS team_missions,
        te.success_rate AS team_success_rate
    FROM 
        agent_performance_view ap
    LEFT JOIN 
        affiliation_metrics am ON ap.agent_id = am.agent_id
    LEFT JOIN 
        skill_proficiency sp ON ap.agent_id = sp.agent_id
    LEFT JOIN 
        team_effectiveness_view te ON ap.agent_id = te.team_id;
END$$

DELIMITER ;

-- ### 2.2 Affiliation Strength
-- **Q1: How do different affiliations affect mission outcomes?**

DROP PROCEDURE IF EXISTS GetMissionOutcomesByAffiliations;
DELIMITER $$

CREATE PROCEDURE GetMissionOutcomesByAffiliations()
BEGIN
    SELECT 
        ar.affiliation_id, 
        a.affiliation_name, 
        COUNT(m.mission_id) AS total_missions, 
        SUM(CASE WHEN m.mission_status = 'Completed' THEN 1 ELSE 0 END) AS successful_missions,
        ROUND(SUM(CASE WHEN m.mission_status = 'Completed' THEN 1 ELSE 0 END) / COUNT(m.mission_id) * 100, 2) AS success_rate
    FROM 
        affiliation_relationship ar
    LEFT JOIN 
        mission m ON ar.agent_id = m.agent_id
    LEFT JOIN 
        affiliation a ON ar.affiliation_id = a.affiliation_id
    GROUP BY 
        ar.affiliation_id;
END$$

DELIMITER ;

-- **Q2: Is there a correlation between the strength of an agent’s affiliation and their success rate?**

DROP PROCEDURE IF EXISTS GetAffiliationStrengthCorrelation;
DELIMITER $$

CREATE PROCEDURE GetAffiliationStrengthCorrelation()
BEGIN
    SELECT 
        am.agent_id, 
        am.avg_affiliation_strength, 
        ap.successful_missions / ap.total_missions * 100 AS success_rate
    FROM 
        affiliation_metrics am
    JOIN 
        agent_performance_view ap ON am.agent_id = ap.agent_id
    WHERE 
        ap.total_missions > 0;
END$$

DELIMITER ;

-- ### 2.3 Skill Proficiency
-- **Q1: What skills are most prevalent among top-performing agents?**

DROP PROCEDURE IF EXISTS GetCommonSkillsAmongTopAgents;
DELIMITER $$

CREATE PROCEDURE GetCommonSkillsAmongTopAgents()
BEGIN
    SELECT 
        s.skill_name, 
        COUNT(sr.agent_id) AS agent_count
    FROM 
        skill s
    JOIN 
        skill_relationship sr ON s.skill_id = sr.skill_id
    JOIN 
        agent_performance_view ap ON sr.agent_id = ap.agent_id
    WHERE 
        ap.successful_missions / ap.total_missions * 100 >= 75
    GROUP BY 
        s.skill_name
    ORDER BY 
        agent_count DESC;
END$$

DELIMITER ;

-- **Q2: Do agents with specific skill sets consistently perform better in missions?**

DROP PROCEDURE IF EXISTS GetSkillSuccessCorrelation;
DELIMITER $$

CREATE PROCEDURE GetSkillSuccessCorrelation()
BEGIN
    SELECT 
        s.skill_name, 
        ROUND(AVG(ap.successful_missions / ap.total_missions * 100), 2) AS avg_success_rate
    FROM 
        skill_relationship sr
    JOIN 
        skill s ON sr.skill_id = s.skill_id
    JOIN 
        agent_performance_view ap ON sr.agent_id = ap.agent_id
    GROUP BY 
        s.skill_name
    ORDER BY 
        avg_success_rate DESC;
END$$

DELIMITER ;

-- ### 2.4 Team Effectiveness
-- **Q1: How does the team composition affect the overall success of missions?**

DROP PROCEDURE IF EXISTS GetTeamCompositionEffectiveness;
DELIMITER $$

CREATE PROCEDURE GetTeamCompositionEffectiveness()
BEGIN
    SELECT 
        t.team_id, 
        t.team_name, 
        COUNT(tr.agent_id) AS team_size, 
        te.success_rate
    FROM 
        team_relationship tr
    JOIN 
        team t ON tr.team_id = t.team_id
    JOIN 
        team_effectiveness_view te ON t.team_id = te.team_id
    GROUP BY 
        t.team_id, t.team_name, te.success_rate
    ORDER BY 
        te.success_rate DESC;
END$$

DELIMITER ;

-- ### 2.5 Mission Success
-- **Q1: What factors contribute most to successful missions?**

DROP PROCEDURE IF EXISTS GetMissionSuccessFactors;
DELIMITER $$

CREATE PROCEDURE GetMissionSuccessFactors()
BEGIN
    SELECT 
        ms.mission_id, 
        ms.mission_name, 
        ms.security_clearance_level, 
        te.success_rate AS team_success_rate, 
        ms.agent_name, 
        ROUND(ag.successful_missions / ag.total_missions * 100, 2) AS agent_success_rate,
        am.avg_affiliation_strength
    FROM 
        mission_summary_view ms
    JOIN 
        team_effectiveness_view te ON ms.team_name = te.team_name
    JOIN 
        affiliation_metrics am ON ms.agent_name = am.agent_name
	JOIN
		agent_performance ag ON ms.agent_name = ag.agent_name;
END$$

DELIMITER ;

CALL GetMissionSuccessFactors; 
-- **Q2: Does having a higher security clearance or proficiency in multiple languages impact the success rate?**

DROP PROCEDURE IF EXISTS GetSecurityClearanceImpact;
DELIMITER $$

CREATE PROCEDURE GetSecurityClearanceImpact()
BEGIN
    SELECT 
        ms.security_clearance_level, 
        COUNT(ms.mission_id) AS total_missions, 
        SUM(CASE WHEN ms.mission_status = 'Completed' THEN 1 ELSE 0 END) AS successful_missions,
        ROUND(SUM(CASE WHEN ms.mission_status = 'Completed' THEN 1 ELSE 0 END) / COUNT(ms.mission_id) * 100, 2) AS success_rate
    FROM 
        mission_summary_view ms
    GROUP BY 
        ms.security_clearance_level;
END$$

DELIMITER ;

-- ### 2.6 Security Clearances and Mission Access
-- **Q1: What levels of security clearance are most common for high-profile missions?**

DROP PROCEDURE IF EXISTS GetCommonSecurityClearanceLevels;
DELIMITER $$

CREATE PROCEDURE GetCommonSecurityClearanceLevels()
BEGIN
    SELECT 
        ms.security_clearance_level, 
        COUNT(ms.mission_id) AS mission_count
    FROM 
        mission_summary_view ms
    GROUP BY 
        ms.security_clearance_level
    ORDER BY 
        mission_count DESC;
END$$

DELIMITER ;

-- **Q2: Is there a link between higher security clearances and mission success?**

DROP PROCEDURE IF EXISTS GetClearanceSuccessCorrelation;
DELIMITER $$

CREATE PROCEDURE GetClearanceSuccessCorrelation()
BEGIN
    SELECT 
        ms.security_clearance_level, 
        COUNT(ms.mission_id) AS total_missions, 
        SUM(CASE WHEN ms.mission_status = 'Completed' THEN 1 ELSE 0 END) AS successful_missions,
        ROUND(SUM(CASE WHEN ms.mission_status = 'Completed' THEN 1 ELSE 0 END) / COUNT(ms.mission_id) * 100, 2) AS success_rate
    FROM 
        mission_summary_view ms
    GROUP BY 
        ms.security_clearance_level;
END$$

DELIMITER ;

-- ### 2.7 Language Proficiency
-- **Q1: Do agents with proficiency in multiple languages have a higher success rate in missions?**

DROP PROCEDURE IF EXISTS GetMultiLanguageAgentSuccess;
DELIMITER $$

CREATE PROCEDURE GetMultiLanguageAgentSuccess()
BEGIN
    SELECT 
        ap.agent_name, 
        COUNT(DISTINCT lr.language_id) AS total_languages, 
        ROUND(SUM(ap.successful_missions) / SUM(ap.total_missions) * 100, 2) AS success_rate
    FROM 
        agent_performance_view ap
    JOIN 
        language_relationship lr ON ap.agent_id = lr.agent_id
    GROUP BY 
        ap.agent_id, ap.agent_name
    HAVING 
        total_languages > 1
    ORDER BY 
        success_rate DESC;
END$$

DELIMITER ;

