-- Logging High-Security Clearance Assignments: Automatically log when a new agent with a “Top Secret” clearance is assigned to a mission
-- Creating a log table
DROP TABLE IF EXISTS high_clearance_log;

CREATE TABLE IF NOT EXISTS high_clearance_log (
    log_id INT AUTO_INCREMENT PRIMARY KEY,
    mission_id INT,
    agent_id INT,
    log_time DATETIME DEFAULT CURRENT_TIMESTAMP
);

-- Creating the trigger 
DROP TRIGGER IF EXISTS log_high_clearance_assignment;
DELIMITER $$

CREATE TRIGGER log_high_clearance_assignment 
AFTER INSERT ON mission
FOR EACH ROW
BEGIN
    IF NEW.access_id = (SELECT sc_id FROM security_clearance WHERE sc_level = 'Top Secret' LIMIT 1) THEN
        INSERT INTO high_clearance_log (mission_id, agent_id, log_time)
        VALUES (NEW.mission_id, NEW.agent_id, NOW());
    END IF;
END$$

DELIMITER ;

-- Logging Agents Assigned to Multiple Teams: If an agent is assigned to more than two teams, create a log for review
-- Creating a log table 
DROP TABLE IF EXISTS team_assignment_log;
CREATE TABLE IF NOT EXISTS team_assignment_log (
    log_id INT AUTO_INCREMENT PRIMARY KEY,
    agent_id INT,
    log_time DATETIME DEFAULT CURRENT_TIMESTAMP
);

-- Creating the trigger 
DROP TRIGGER IF EXISTS log_multiple_team_assignments;
DELIMITER $$

CREATE TRIGGER log_multiple_team_assignments 
AFTER INSERT ON team_relationship
FOR EACH ROW
BEGIN
    DECLARE team_count INT;

    -- Count the number of teams assigned to the inserted agent
    SELECT COUNT(team_id) INTO team_count 
    FROM team_relationship 
    WHERE agent_id = NEW.agent_id;

    -- If the agent is assigned to more than two teams, log it
    IF team_count > 2 THEN
        INSERT INTO team_assignment_log (agent_id, log_time)
        VALUES (NEW.agent_id, NOW());
    END IF;
END$$

DELIMITER ;

